     window.open("https://netflix-clone-da152.web.app/")
  }
    return (
    	<div>
    	<div onClick={callNetflix}>
			 <Product
			 	id="1245"
			 	title="The Lean Startup: How Today's Entrepreneurs Use Continuous Innovation to Create Radically Successful Businesses"
			 	image={netflix}
			   />
			</div>
			<div onClick={callNetflix}>
			    <Product
			 	id="1245"
			 	title="The Lean Startup: How Today's Entrepreneurs Use Continuous Innovation to Create Radically Successful Businesses"
			 	image={netflix}
			   />
			  </div>
			</div>
    )
}

